      subroutine gufld(r,B)
      implicit none
      real r(3),B(3)
      real rr(3),rs(3),BB(3)
      integer iregion
      integer getMap
      external getMap

      real orig1(3),rmat1(3,3)
      data orig1/0,0,0/
      data rmat1/1,0,0,
     +          0,1,0,
     +          0,0,1/
      real orig2(3),rmat2(3,3)
      data orig2/0,0,166.015/
      data rmat2/1,0,0,
     +          0,1,0,
     +          0,0,1/

      iregion = getMap()
      if (iregion.eq.0) then
        B(1) = 0
        B(2) = 0
        B(3) = 0
      else if (iregion.eq.1) then
        rs(1) = r(1)-orig1(1)
        rs(2) = r(2)-orig1(2)
        rs(3) = r(3)-orig1(3)
        rr(1) = rs(1)*rmat1(1,1)+rs(2)*rmat1(1,2)+rs(3)*rmat1(1,3)
        rr(2) = rs(1)*rmat1(2,1)+rs(2)*rmat1(2,2)+rs(3)*rmat1(2,3)
        rr(3) = rs(1)*rmat1(3,1)+rs(2)*rmat1(3,2)+rs(3)*rmat1(3,3)
        call gufld1(rr,BB)
        B(1) = BB(1)*rmat1(1,1)+BB(2)*rmat1(2,1)+BB(3)*rmat1(3,1)
        B(2) = BB(1)*rmat1(1,2)+BB(2)*rmat1(2,2)+BB(3)*rmat1(3,2)
        B(3) = BB(1)*rmat1(1,3)+BB(2)*rmat1(2,3)+BB(3)*rmat1(3,3)
        B(1) = B(1)*0.001
        B(2) = B(2)*0.001
        B(3) = B(3)*0.001
      endif
      end

      subroutine gufld1(r,B)
      implicit none
      real r(3),B(3)
      real rho,phi,alpha
      real u(3)
      real twopi
      parameter (twopi=6.28318530717959)

      real bound0(3,2)
      data bound0/10,0,-10,
     +            -340,-1.5,1600/
      integer reverse0(3)
      data reverse0/-1,1,-1/
      real bound1(3,2)
      data bound1/10,0,-10,
     +            -340,1.5,1600/
      integer reverse1(3)
      data reverse1/1,1,1/
      real Bmap(3,351,16,1611)
      integer nsites(3)
      data nsites/351,16,1611/
      logical loaded
      data loaded/.false./
      save Bmap,nsites,loaded
      integer i,i1,i2,i3

      if (.not.loaded) then
        open(unit=78,file='taggerBfield-quad.map',status='old',err=7)
        read(unit=78,fmt=*,err=5,end=6)
     +      ((((Bmap(i,i1,i2,i3),i=1,3),
     +         i2=1,16),
     +        i3=1,1611),
     +       i1=1,351)
        go to 8
    5   stop 'error reading magnetic field map, stop'
    6   stop 'EOF encountered reading magnetic field map, stop'
    7   stop 'error opening magnetic field map, stop'
    8   loaded=.true.
      endif

      u(1) = (r(1)-bound0(1,1))/(bound0(1,2)-bound0(1,1))
      u(2) = (r(2)-bound0(2,1))/(bound0(2,2)-bound0(2,1))
      u(3) = (r(3)-bound0(3,1))/(bound0(3,2)-bound0(3,1))
      if ((u(1).ge.0.and.u(1).le.1).and.
     +    (u(2).ge.0.and.u(2).le.1).and.
     +    (u(3).ge.0.and.u(3).le.1)) then
        call interpol3(Bmap,nsites,u,B)
        B(1)=B(1)*reverse0(1)
        B(2)=B(2)*reverse0(2)
        B(3)=B(3)*reverse0(3)
        return
      endif

      u(1) = (r(1)-bound1(1,1))/(bound1(1,2)-bound1(1,1))
      u(2) = (r(2)-bound1(2,1))/(bound1(2,2)-bound1(2,1))
      u(3) = (r(3)-bound1(3,1))/(bound1(3,2)-bound1(3,1))
      if ((u(1).ge.0.and.u(1).le.1).and.
     +    (u(2).ge.0.and.u(2).le.1).and.
     +    (u(3).ge.0.and.u(3).le.1)) then
        call interpol3(Bmap,nsites,u,B)
        B(1)=B(1)*reverse1(1)
        B(2)=B(2)*reverse1(2)
        B(3)=B(3)*reverse1(3)
        return
      endif

      B(1) = 0
      B(2) = 0
      B(3) = 0
      return
      end

      subroutine interpol3(Bmap,nsites,u,B)
      implicit none
      integer nsites(3)
      real Bmap(3,nsites(1),nsites(2),nsites(3))
      real u(3),B(3)
      integer ir(3),ir0(3),ir1(3)
      real ur(3),dur(3),ugrad(3,3)
      integer i
      do i=1,3
        ur(i)=u(i)*(nsites(i)-1)+1
        ir(i)=nint(ur(i))
        ir0(i)=max(ir(i)-1,1)
        ir1(i)=min(ir(i)+1,nsites(i))
        dur(i)=(ur(i)-ir(i))/(ir1(i)-ir0(i)+1e-20)
      enddo
      ugrad(1,1)=(Bmap(1,ir1(1),ir(2),ir(3))-Bmap(1,ir0(1),ir(2),ir(3)))
      ugrad(2,1)=(Bmap(2,ir1(1),ir(2),ir(3))-Bmap(2,ir0(1),ir(2),ir(3)))
      ugrad(3,1)=(Bmap(3,ir1(1),ir(2),ir(3))-Bmap(3,ir0(1),ir(2),ir(3)))
      ugrad(1,2)=(Bmap(1,ir(1),ir1(2),ir(3))-Bmap(1,ir(1),ir0(2),ir(3)))
      ugrad(2,2)=(Bmap(2,ir(1),ir1(2),ir(3))-Bmap(2,ir(1),ir0(2),ir(3)))
      ugrad(3,2)=(Bmap(3,ir(1),ir1(2),ir(3))-Bmap(3,ir(1),ir0(2),ir(3)))
      ugrad(1,3)=(Bmap(1,ir(1),ir(2),ir1(3))-Bmap(1,ir(1),ir(2),ir0(3)))
      ugrad(2,3)=(Bmap(2,ir(1),ir(2),ir1(3))-Bmap(2,ir(1),ir(2),ir0(3)))
      ugrad(3,3)=(Bmap(3,ir(1),ir(2),ir1(3))-Bmap(3,ir(1),ir(2),ir0(3)))
      B(1)=Bmap(1,ir(1),ir(2),ir(3))
     +       +ugrad(1,1)*dur(1)+ugrad(1,2)*dur(2)+ugrad(1,3)*dur(3)
      B(2)=Bmap(2,ir(1),ir(2),ir(3))
     +       +ugrad(2,1)*dur(1)+ugrad(2,2)*dur(2)+ugrad(2,3)*dur(3)
      B(3)=Bmap(3,ir(1),ir(2),ir(3))
     +       +ugrad(3,1)*dur(1)+ugrad(3,2)*dur(2)+ugrad(3,3)*dur(3)
      end
